# for j in range(4):
#   print(y[j])
def normalize(v):
    norm = np.linalg.norm(v)
    if norm == 0: 
       return v
    return v / norm

def normalize2(_d, to_sum=True, copy=True):
    # d is a (n x dimension) np array
    d = _d if not copy else np.copy(_d)
    d -= np.min(d, axis=0)
    d /= (np.sum(d, axis=0) if to_sum else np.ptp(d, axis=0))
    return d

def rndFrmt(x):
  w = np.array(x)
  z = w.astype(np.float)
  y = np.linalg.norm(z)

  output = "[\n"
  for i in range(len(x)):
    output+="["
    for j in range(len(x[i])):

      b = (float(x[i][j]))/y
      print(b)
      c = np.array(b)
      d = c.astype(np.float)
      output+=str(d)
      
    output+="]\n"
  output+="]"
  return output

